INSERT INTO article VALUES(1,'Czech, Prague','2022-01-01',replace('Across from my residence was a blues bar, where every night, I''d occupy a table alone, listening to four bald Bohemian men play the most enjoyable Jazz I''ve ever heard, sipping a Mojito until midnight. Not until the sixth night did I meet a 26-year-old Czech historian and writer at the next table, who was also alone. We subsequently spent an entire day tracing the historical footsteps of Prague during World War II, mourning in front of Wenceslas Square and the National Museum, taking the light rail to the desolate outskirts, listening to him passionately tell me about the blood once spilled on this land under our feet and the legends that no one inquires about.\n\n"In 1945, Prague had only 500,000 people, 300,000 of whom took to the streets to fight the Nazis, with the remaining 200,000 providing logistical support for those 300,000. The Gestapo headquarters, the battle of the radio, Operation Anthropoid, Nicholas Winton... We have many, many good stories that deserve to be heard by more people. Even when hundreds of thousands of Czechs were expelled during World War II, they never stopped fighting back against the Nazis. You could see Czech soldiers in London, Paris, the Soviet Union, and even Shanghai, India, and the Philippines. We didn''t have the ability to fight the Nazis on our own land, but we could at least help those countries that did."\n\n"From the moment I first read about Operation Anthropoid in a textbook at the age of 8, I decided to become a historian. I couldn''t become a hero, but I could be someone who lets more people know about heroes. Too many tourists come to Prague to take pictures and then leave, which I''m not happy about; I want to do something. Maybe our history is not as magnificent and long as that of France, Britain, or your country, but every Czech is genuinely proud of their country, not for political reasons or populism, but because every Czech''s ancestors have participated to some extent in the resistance and independence of this country."\n\nWalking the streets of Prague, my deepest impression is that this city belongs to the pigeons. They are in the town squares, on the battlements of Charles Bridge, on the surface of the Vltava River, on the head of the Hus statue, on the heads of every statue you can see. Almost every one.\n\nMany papal figures'' statues often wear Gothic pointed crowns, symbolizing the supremacy of divine power and their own unattainability. People kneel in worship, but pigeons don''t care about these. The towering and hollow crowns are often the best places to excrete, and the statues of scholars and religious reformers with flat or even pointed tops are the favorite habitats of flocks of pigeons. There are always some people, always some beliefs, fearless of the changes in the world.','\n',char(10)),1697989752002,1697990915788,1697990915784,1,1,'en');
INSERT INTO article VALUES(2,'捷克，布拉格','2022-01-01',replace('住处对面就是一家蓝调酒吧，每晚都会一个人占一张桌子，听四个秃头的波西米亚大汉弹奏我所听过最尽兴的Jazz，点上一杯莫吉托喝到半夜。直到第六晚，在隔壁桌认识了一位同样子然一身的年仅26岁的捷克历史学家与作家。我们随即花了一整天沿着布拉格二战时期的历史足迹穿行，在瓦茨拉夫广场和国家博物馆前悼怀，乘轻轨去往人烟罕至的荒郊野岭，听他激动地向我讲述脚下的一方天地曾沾染过的鲜血，和无人问津的传奇。\n\n「1945年布拉格总人口只有50万，30万都走上了街头与纳粹开战，剩下的20万为那30万保障着后勤。盖世太保总部、广播之战、类人猿行动、尼古拉斯•温斯顿…我们有许多许多好故事值得更多人听到。二战时哪怕几十万捷克人被驱逐，他们也从未停止反击纳粹。你可以在伦敦、巴黎、苏联、甚至上海、印度、菲律宾看到捷克军人的身影。我们没有能力在自己的土地上抗击纳粹，但至少可以助那些有能力的国家一臂之力。」\n\n「8岁第一次在教科书上读到类人猿行动的那一刻起，我就决心要当一名历史学家。我成为不了英雄，但我可以成为让更多人知道英雄的人。太多游客来布拉格拍照，然后离开，我很不高兴，我想做点什么。也许我们的历史不如法国英国或你的国家那样壮丽悠久，但每一个捷克人都发自内心地为自己的国家骄傲，这不是出于政治需要，也不是出于民粹主义，而是因为每个捷克人的祖辈都一定程度参与过这个国家的反抗和独立。」\n\n走在布拉格的街头最深的感触是，这座城市是属于鸽子的。它们在1城广场上，在查理桥头堡的顶端，在沃塔瓦河面，在胡斯雕像的头顶，在每一尊你能看见的雕像的头顶。\n几乎每一尊。\n\n许多教宗人士的雕像往往带着哥特式的尖顶冠冕，象征着神权的至高无上，也同样象征自身的高不可攀。人们跪拜信仰，鸽子可不管这些。四周高耸而中空的冠冕往往是最佳的排泄地，平顶甚至秀顶的学者与宗教改革者们的雕像，才是鸽群们最爱的栖息之处。\n总有些人，总有些信念，无惧世事变迁。\n','\n',char(10)),1697989823114,1697990977770,1697990977763,1,1,'zh-CN');
